import { StatusBar } from "expo-status-bar";
import React from "react";
import { ImageBackground, StyleSheet, Text, View } from "react-native";

// const image = { uri: "./assets/engagement.jpeg" };
const image = {
  uri:
    "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.99images.com%2Fphotos%2Fwallpapers%2F3d-abstract%2Faesthetic-sunandroid-iphone-desktop-hd-backgrounds-wallpapers-1080p-4k-ipv0s.jpg%3Fv%3D1577318880&f=1&nofb=1",
};

export default function App() {
  return (
    <View style={styles.container}>
      <ImageBackground source={image} style={styles.image}>
        <Text>Welcome to the Mun Family app!</Text>
        <StatusBar style="auto" />
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  image: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center",
  },
});
